// About.js
import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about-container">
      <h2>About Us</h2>
      <div className="about-content">
        <p>
          Welcome to our company! We are dedicated to delivering the best service
          to our customers. Our team is composed of highly skilled professionals
          who are passionate about what they do.
        </p>
        <p>
          Our mission is to provide innovative solutions and create value for our
          clients. We believe in integrity, excellence, and building long-term
          relationships with our customers.
        </p>
        <p>
          Established in [Year], we have grown to become a trusted name in the
          industry. Our commitment to quality and customer satisfaction sets us
          apart from our competitors.
        </p>
        <p>
          Thank you for choosing us. We look forward to working with you and
          achieving great things together.
        </p>
      </div>
    </div>
  );
};

export default About;
